// AdminManageUsersPage.jsx
import React from "react";
import AdminManagePage from "./AdminManagePage";

class AdminManageProfPage extends React.Component {
    render() {
      return (
        <AdminManagePage
          pageTitle="Welcome to Users and Professions Manage"
          listTitle="Professions List"
          formTitle="Add New Profession"
          apiEndpoint="http://localhost:5000/get_prof"
          dataKey="professions"
          renderItem={(prof) => (
            <>
              (Profession Name: {prof.profession_name}) (Description: {prof.profession_description})
            </>
          )}
          renderForm={() => (
            <form method="post" action="http://localhost:5000/add_prof">
              <label>Profession Name:</label>
              <input type="text" name="profession_name" required />
              <label>Description:</label>
              <input type="text" name="profession_description" />
              <button type="submit">Add Profession</button>
            </form>
          )}
        />
      );
    }
  }
export default AdminManageUsersPage;
